import React from "react";
import "./App.css";
import Row from "./Row";
import requests from "./req";
import Banner from "./Banner";
import Nav from "./Nav";
import appcss from './App.css'
import Rowcss from './Row.css'


function App() {
  return (
    <div className="app">
      <Nav />
      <Banner />
      <Row title="Trending NOW" fetchUrl={requests.fetchTrending} isLargeRow/>
    </div>
  );
}

export default App;
